import React from "react";
import "../style.css"
import { 
    MDBCard,
    MDBCardBody,
    MDBRow,
    MDBCol
 } from "mdb-react-ui-kit";




export function tableSection(props) {

    const {tableTitle} = props

     return(
         <MDBCard>
             <MDBCardBody>
                 <MDBRow className="h-20">
                     <MDBCol>
                         <h3>{tableTitle}</h3>
                     </MDBCol>
                 </MDBRow>
                 <MDBRow className="tableSection-body h-60">
                    <MDBCol>

                    </MDBCol>
                 </MDBRow>
             </MDBCardBody>
         </MDBCard>
     )



}
